import React, {useContext} from 'react';
import { GlobalContext } from '../context/GlobalState';

export const SearchItem = ({ mySymbol }) => {
  const { selectStock } = useContext(GlobalContext);

  return (
    <div className='card card-body mb-1'>
      <button onClick={() => selectStock(mySymbol.symbol)} className="btn-primary">
        <h4> {mySymbol.symbol}   {mySymbol.name}</h4>
      </button>
    </div>
  )
}


